import React, { useMemo, useEffect } from "react";
import "aos/dist/aos.css";
import "./styles/timetable.css";

// Utility function to calculate the start of the current week
const getStartOfWeek = (date) => {
  const startOfWeek = new Date(date);
  const day = startOfWeek.getDay() || 7; // Make Sunday (0) the last day
  if (day !== 1) startOfWeek.setDate(startOfWeek.getDate() - day + 1);
  startOfWeek.setHours(0, 0, 0, 0);
  return startOfWeek;
};

// Group tasks by day of the week
const getTasksByDay = (tasks, weekDays) => {
  return weekDays.map((day) =>
    tasks.filter(
      (task) =>
        task.startTime >= day &&
        task.startTime < new Date(day.getTime() + 24 * 60 * 60 * 1000)
    )
  );
};

// Render tasks for a specific day
const renderTasks = (tasks, columnIndex) => {
  if (!tasks || tasks.length === 0) return null;

  // Sort tasks by start time
  tasks.sort((a, b) => a.startTime - b.startTime);

  return tasks.map((task, index) => {
    const startMinutes =
      task.startTime.getHours() * 60 + task.startTime.getMinutes();
    const endMinutes = task.endTime.getHours() * 60 + task.endTime.getMinutes();
    const top = startMinutes;
    const height = endMinutes - startMinutes;

    // Calculate width for overlapping tasks
    const overlappingTasks = tasks.filter(
      (otherTask) =>
        (task.startTime < otherTask.endTime &&
          task.endTime > otherTask.startTime) ||
        task === otherTask
    );
    const taskWidth = `calc(${100 / overlappingTasks.length}% - 5px)`;

    const leftOffset = `${(100 / overlappingTasks.length) * index}%`;

    return (
      <div
        key={index}
        className="task-block"
        style={{
          top: `${top}px`,
          height: `${height}px`,
          width: taskWidth,
          left: leftOffset,
        }}
        title={`${task.name}\nStart: ${task.startTime.toLocaleTimeString()}\nEnd: ${task.endTime.toLocaleTimeString()}`}
      >
        {task.name}
      </div>
    );
  });
};

const TimeTable = ({ tasks = [] }) => {
  if (!Array.isArray(tasks)) {
    console.error("Tasks should be an array");
    tasks = [];
  }

  const days = useMemo(
    () => ["Thứ 2", "Thứ 3", "Thứ 4", "Thứ 5", "Thứ 6", "Thứ 7", "Chủ Nhật"],
    []
  );
  const hours = useMemo(
    () =>
      Array.from({ length: 24 }, (_, i) => `${i}:00 - ${i + 1}:00`),
    []
  );

  const startOfWeek = useMemo(() => getStartOfWeek(new Date()), []);
  const weekDays = useMemo(
    () =>
      Array.from({ length: 7 }, (_, i) => {
        const day = new Date(startOfWeek);
        day.setDate(day.getDate() + i);
        return day;
      }),
    [startOfWeek]
  );

  const tasksByDay = useMemo(() => getTasksByDay(tasks, weekDays), [tasks, weekDays]);

  useEffect(() => {
    console.log("Tasks received in TimeTable:", tasks);
  }, [tasks]);

  return (
    <div className="main-form" data-aos="zoom-in">
      <header className="search-bar">
        <h1>Weekly TimeTable</h1>
      </header>

      <div className="timetable-container">
        <div className="header-row">
          <div className="header-cell time-column">Thời gian</div>
          {days.map((day, index) => (
            <div key={index} className="header-cell">
              {day}
              <br />
              <span className="date-text">
                {weekDays[index].getDate()}/{weekDays[index].getMonth() + 1}
              </span>
            </div>
          ))}
        </div>

        <div className="body-container">
          <div className="time-column">
            {hours.map((hour, index) => (
              <div key={index} className="time-slot">
                {hour}
              </div>
            ))}
          </div>
          {days.map((_, index) => (
            <div key={index} className={`column column-${index}`}>
              {renderTasks(tasksByDay[index], index)}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default TimeTable;
